mapper.select:

select 

from MST_SUBJECT_FC
where Fnc_Kb = #{fncKb,jdbcType=NCHAR}
  and Fnc_Dtl_Kb = #{fncDtlKb,jdbcType=NCHAR}
  and Rel_Com_Cls = #{relComCls,jdbcType=NCHAR}
  and Dsp_Order = #{dspOrder,jdbcType=NUMERIC}

mapper.delete:

delete from MST_SUBJECT_FC
where Fnc_Kb = #{fncKb,jdbcType=NCHAR}
  and Fnc_Dtl_Kb = #{fncDtlKb,jdbcType=NCHAR}
  and Rel_Com_Cls = #{relComCls,jdbcType=NCHAR}
  and Dsp_Order = #{dspOrder,jdbcType=NUMERIC}
